import axios from 'axios';
import React, { useState, useEffect } from 'react';

function Main() {

  async function getUsers() {
    try {
      const response = await axios.get('http://localhost:8000/users');
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

  useEffect(() => {
    getUsers();
  }, [])

  return (
    <div className="main">
      <h1>Hello World!</h1>
    </div>
  );
}

export default Main;
